        Peroxide&lt;\/searchLink&gt; ; &lt;searchLink fieldCode=&quot;MH&quot; term=&quot;%22Ozone%22&quot;&gt;Ozone&lt;\/searchLink&gt;"},{"Name":"Abstract","Label":"Abstract","Group":"Ab","Data":"In
        this paper, Fe3O4\/multi-wall carbon nanotubes composites were prepared, characterized
        and used as a catalyst for enhancing the ozonation of dimethyl phthalate (DMP)
        in aqueous solution. The experimental results showed that DMP degradation
        and mineralization increased by 26% and 20%, respectively, in catalytic ozonation
        compared with single ozonation, and more H2O2 and organic acids were produced
        during catalytic ozonation process than single ozonation. The effect of pH,
        ozone concentration and catalyst dosage on DMP degradation was determined.
        The addition of tert-butanol and phosphates showed a negative effect on DMP
        degradation, suggesting that the acidic sites on the catalyst is favorable
        to ozone decomposition to produce hydroxyl radicals. The possible mechanism
        for catalytic ozonation of DMP was tentatively proposed. The adsorption of
        ozone and organics onto the surface of catalyst could improve the DMP degradation."},{"Name":"SubjectMinor","Label":"Contributed
